import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Button, Typography } from '@mui/material';

function HomePage() {
  const [tenantId, setTenantId] = useState(1); // Set tenantId to 1 initially
  const navigate = useNavigate();

  const handleProceed = () => {
    // Navigate to the organisations page, passing the tenantId
    navigate('/organisations', { state: { tenantId } });
  };

  return (
    <div>
      <Typography variant="h4">Welcome to the Home Page</Typography>
      <Typography variant="body1">This is the default landing page of the application.</Typography>
      <Button variant="contained" color="primary" onClick={handleProceed}>
        Go to Organisations
      </Button>
    </div>
  );
}

export default HomePage;
